- input: "TEXT\x1CC00030718\x1C1\x1C\x1CF3XN\x1COn Line 21b of this report, the contra
    disbursement in the amount of $ 610.00, to National Association of Realtors, dated
    5/15/13 reported and transferred to Line 23, the full purpose of disbursement
    should be noted as: In-Kind Facilitation of Earmarked Contributions.  This amount
    relates to an original $8,000.00 advance payment made to the National Association
    of Realtors for future consulting and related services, which was made on 4/16/12
    and reported on Line 21b of the May 2012 monthly report.    In 2013, we have applied
    & reported $ 1,4360.00 of this advance payment for consulting services attributable
    to In-Kind events & reflected as negative amounts subtracted from Line 21b and
    transferred to Line 23. In the current May 2013 reporting period, a total of $
    610.00 of the original $8,000.00 is being applied to payments in connection with
    consulting services provided as in kind contributions attributable to seven separate
    events and each reflected on Line 23 of this period, as follows: 1)Transfer $600.00
    from Line 21b to Line 23 attributable to services provided on 5/15/13 to facilitate
    online fundraising and deemed contributions to the following 6 committees in the
    amount of $100.00 each: Texans For Senator John Cornyn Inc.;  Friends of Jeanne
    Shaheen;   Stivers For Congress;  Michael Grimm For Congress;  Cantor For Congress;
    \ David Scott For Congress;  2) Transfer $10.00 from Line 21b to Line 23 attributable
    to consulting services provided on 5/15/2013 to facilitate online fundraising
    and deemed a contribution to Mulvaney For Congress.   For Line 22 of this report,
    the disbursements to Political Survival Fund for $10.00 on 5/07/2013, Illinois
    RPAC for $107.40 on 5/07/13 & Vermont RPAC for $300.00 on 5/06/2013 represent
    refunds for transmissions of funds inadvertently sent in error by the respective
    state agent. \n"
